import React from 'react';
import './result.css';
import logo from './Logo2.png';

function SearchBar(props) {
    return (
        <div id="searchbar">
            <form onSubmit={event => {
                event.preventDefault();
                const search = event.target.search.value;
                props.onCreate(search);
            }}>
                <p><input type="text" name="search" placeholder="Search..." onKeyPress={(event) => {
                    if(event.keyCode === 13) {
                        event.preventDefault();
                        props.onCreate(event.target.value);
                    }
                }}/></p>
            </form>
        </div>
    );
}

function LogoImage() {
    return (
        <div id="logo">
            <img src={logo}
                 className="Result-logo"
                 alt="logo"
                 onClick={() => {
                     // 메인 화면으로 이동
                 }}/>
        </div>
    );
}

function ObjectionButton() {
    return (
        <div id="objection">
            <button
                onClick={event => {
                    event.preventDefault();
                    // 이의신청 하기
                }}>이의신청</button>
        </div>
    );
}

function ResultBox() {
    return (
        <div id="resultBox">
            <div className="link">https://www.youtube.com</div>
            <br />
            <div className="description">
                <p>
                    <span className="span">
                        사이트명 : Youtube
                        <br />
                        <br />
                        피싱 사이트 여부 :
                    </span>
                    <span> 피싱 사이트가 아님</span>
                </p>
            </div>
        </div>
    );
}

function SideBar() {
    return (
        <div id="left">
            <div className="black-list">
                <hr />
                <a href="#">Black List</a>
                <p className="element">
                    블랙리스트를 확인할 수 있는 게시판
                    <br />
                    현재 등록된 사이트 : 14,042개
                </p>
                <hr />
            </div>
            <div className="white-list">
                <a href="#">White List</a>
                <p className="element">
                    화이트리스트를 확인할 수 있는 게시판
                    <br />
                    현재 등록된 사이트 : 240,410개
                </p>
                <hr />
            </div>
        </div>
    );
}

function Result() {
    return (
        <div>
            <div id="top">
                <LogoImage />
                <SearchBar onCreate={(search) => { console.log(search); }} /> {/* SearchBar에 onCreate prop 추가 */}
            </div>
            <br />
            <SideBar />
            <ResultBox />
            <ObjectionButton />
        </div>
    );
}

export default Result;
